import React from 'react';
import logo from './pages/images/logo.png';
import { Breadcrumb, Layout, Menu, Typography } from 'antd';

const { Header, Content, Footer } = Layout;
const { Text } = Typography;

function NavTabs() {
  return (
    <Header
      style={{
        position: 'sticky',
        top: 0,
        zIndex: 1,
        width: '100%',
        display: 'flex',
        alignItems: 'center',
      }}
    >
      <div className="logo">
        <img src={logo} alt="Travel Bug Logo" style={{ width: '200px', height: '50px' }} />
      </div>
      <Breadcrumb>
        <Breadcrumb.Item key="Home">
          <Text level={5} style={{ color: 'white' }}>
            Home
          </Text>
        </Breadcrumb.Item>
        <Breadcrumb.Item key="Attractions">
          <Text level={5} style={{ color: 'white' }}>
            Attractions
          </Text>
        </Breadcrumb.Item>
        <Breadcrumb.Item key="PlacesToGo">
          <Text level={5} style={{ color: 'white' }}>
            Places to Visit
          </Text>
        </Breadcrumb.Item>
        <Breadcrumb.Item key="Restaurants">
          <Text level={5} style={{ color: 'white' }}>
            Restaurants
          </Text>
        </Breadcrumb.Item>
      </Breadcrumb>
    </Header>
  );
}

const App: React.FC = () => {
  return (
    <Layout>
      {NavTabs()} {/* Render the NavTabs component */}
      <Content className="site-layout" style={{ padding: '0 50px' }}>
        <Breadcrumb style={{ margin: '16px 0' }}>
          <Breadcrumb.Item>Home</Breadcrumb.Item>
          <Breadcrumb.Item>List</Breadcrumb.Item>
          <Breadcrumb.Item>App</Breadcrumb.Item>
        </Breadcrumb>
        <Menu
          theme="dark"
          mode="horizontal"
          defaultSelectedKeys={['2']}
          items={new Array(3).fill(null).map((_, index) => ({
            key: String(index + 1),
            label: `nav ${index + 1}`,
          }))}
        />
        <div style={{ padding: 24, minHeight: 380, background: 'your-color-here' }}>
          Content
        </div>
      </Content>
      <Footer style={{ textAlign: 'center' }}>Ant Design Â©2023 Created by Ant UED</Footer>
    </Layout>
  );
};

export default App;
